import React from 'react';
import {NavLink} from "react-router-dom";
// import classes from

const Navbar=()=>{
    return(
        <nav className={classes.nav}>
            <div className={classes.item}>
                <NavLink to="/keyboard">Картинка тренажера</NavLink>
            </div>
            <div className={classes.item}>
                <NavLink to="/keyboard">Тестирование</NavLink>
            </div>
            <div className={classes.item}>
                <NavLink to="/keyboard">Обучение</NavLink>
            </div>
            <div className={classes.item}>
                <NavLink to="/keyboard">Рейтинг</NavLink>
            </div>
            <div className={classes.item}>
                <NavLink to="/keyboard">Регистрация</NavLink>
            </div>
        </nav>);
}

export default Navbar;
